member.summary:
CONNECTION_TYPE property value: An Unknown Provider

Indicates that the provider is unknown.

Set using setIntProperty(JmsConstants.CONNECTION_TYPE, JmsConstants.CT_UNKNOWN_PROVIDER);

Get using getIntProperty(JmsConstants.CONNECTION_TYPE);

Valid for a Connection Factory.

CONNECTION_TYPE property value: MQTT

Indicates that the provider is MQTT.

Set using setIntProperty(JmsConstants.CONNECTION_TYPE, JmsConstants.CT_MQTT);

Get using getIntProperty(JmsConstants.CONNECTION_TYPE);

Valid for a Connection Factory.

ASYNC_EXCEPTIONS property name

Sets the exception types that should be passed to the user's exception listener.

Set using setIntProperty(JmsConstants.ASYNC_EXCEPTIONS, newvalue);

Get using getIntProperty(JmsConstants.ASYNC_EXCEPTIONS);

Valid for a Connection Factory.

CAPABILITY_TRANSACTIONS_XA property name

Boolean property representing whether the provider supports XA.

Get using getBooleanProperty(JmsConstants.CAPABILITY_TRANSACTIONS_XA);

CAPABILITY_TRANSACTIONS_LOCAL property name

Boolean property representing whether the provider supports locally transacted sessions.

Get using getBooleanProperty(JmsConstants.CAPABILITY_TRANSACTIONS_LOCAL);

CAPABILITY_ASF property name

Boolean property representing whether the provider supports ASF.

Get using getBooleanProperty(JmsConstants.CAPABILITY_ASF);

CAPABILITY_POINT_TO_POINT property name

Boolean property representing whether the provider supports point-to-point messaging.

Get using getBooleanProperty(JmsConstants.CAPABILITY_POINT_TO_POINT);

CAPABILITY_PUBLISH_SUBSCRIBE property name

Boolean property representing whether the provider supports publish-subscribe messaging.

Get using getBooleanProperty(JmsConstants.CAPABILITY_PUBLISH_SUBSCRIBE);

CAPABILITY_USERNAME_PASSWORD property name
Boolean property representing whether the provider supports security via a username and password combination.
Get using getBooleanProperty(JmsConstants.CAPABILITY_USERNAME_PASSWORD);

DESTINATION_NAME property name
Destination constant
Name for the destination - this is the base destination name, without the prefix determined by the object type name (i.e. topic:// or queue://), and without the properties that are in the general property context.
Set using setStringProperty(JmsConstants.DESTINATION_NAME, value);
Get using getStringProperty(JmsConstants.DESTINATION_NAME);
Valid on a Destination object.

